snippet.description:
Stan Walker - One (Live at Parachute)- full version
“One” by U2 & “One Love” by Bob Marley
In the midst of all the chaos that has been happening. My hope is to bring hope, life, healing and joy through my music.
Anei taku manawa ❤️
Subscribe to - https://www.youtube.com/@StanWalkerAotearoa for notification
Aroha ki te ao ❤️
📹 - @coast2coastmedia_officia
Thank you U2 and Bob Marley for the gift to the world of these waiatas. 
